import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home'
import Header from "./Components/Header";
import About from "./pages/About";

function App() {
  return (
   <div className="App">
    <BrowserRouter>
      <Header/>

      <div className="pages">
        <Routes>
          <Route
            path="/"
            element={<Home/>}
          />
          <Route
            path="/about"
            element={<About/>}
          />
        </Routes>
      </div>
    </BrowserRouter>
   </div>
  );
}

export default App;
